import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import Register from "./components/Register"
import Users from "./components/Users";
import UserDetails from "./components/UserDetails";

const Stack = createStackNavigator();

function App() {
  return (
      <NavigationContainer>
        <Stack.Navigator>
            <Stack.Screen
                name="Register"
                component={Register}
                options={{
                    title: 'Register Node App',
                    headerStyle: {
                        backgroundColor: '#ff0000',
                    },
                    headerTintColor: '#ffffff',
                    headerTitleStyle: {
                        fontWeight: 'bold',
                        textAlign:'center'
                    },
                }} />
            <Stack.Screen
                name="Users"
                component={Users}
                options={{
                    title: 'Users',
                    headerStyle: {
                        backgroundColor: '#ff0000',
                    },
                    headerTintColor: '#ffffff',
                    headerTitleStyle: {
                        fontWeight: 'bold',
                        textAlign:'center'
                    },
                }} />
            <Stack.Screen
                name="UserDetails"
                component={UserDetails}
                options={{
                    title: 'Users',
                    headerStyle: {
                        backgroundColor: '#ff0000',
                    },
                    headerTintColor: '#ffffff',
                    headerTitleStyle: {
                        fontWeight: 'bold',
                        textAlign:'center'
                    },
                }} />
        </Stack.Navigator>
      </NavigationContainer>
  );
}

export default App;
